Harry and Paul's Story of the Twos

Biography Documentary hosted by Harry Enfield and Paul Whitehouse, published by BBC in 2014 - English narration


Information
------------------------------

As part of the 50th anniversary of BBC Two, Harry Enfield and Paul Whitehouse present their own unique biography of BBC Two. They romp through the story of Two's highs and lows, from imported Scandinavian dramas, via The Forsyte Saga, Tim Nice But Brooke Taylor, Late Night Line Up with Joan Bakewell Tart and Monty Python. It drops into The Office and Boys from the Blackstuff, Arena, Old Grey Whistle Test and The Apprentice among many others. The show visits and parodies in the region of 50 different shows, and there are 150 of BBC Two's favourite presenters, actors, comics and politicians on parade, most of them portrayed by either Harry or Paul, with a little help from their friends. (B/W and colour).

